completed.onChange:
setTimeout(async () => {
    try {
        console.log("Script started. Checking workOrderOperations and workOrderMaterials for:", rowData.rowKey);

        // Fetch all work order operations
        let allWorkOrders = $getGrid('workOrderOperations');
        let allMaterials = $getGrid('workOrderMaterials'); // Fetch all work order materials

        console.log("All work order operations:", allWorkOrders);
        console.log("All work order materials:", allMaterials);

        // Filter work order operations linked to this work order
        let workOrders = allWorkOrders.filter(op => op.workOrder === rowData.rowKey);
        let workMaterials = allMaterials.filter(mat => mat.workOrder === rowData.rowKey); // Filter materials

        if (workOrders.length === 0 && workMaterials.length === 0) {
            console.warn(`No related Work Order Operations or Materials found for workOrder: ${rowData.rowKey}`);
            return;
        }

        console.log(`Found ${workOrders.length} Work Order Operations.`);
        console.log(`Found ${workMaterials.length} Work Order Materials.`);

        // Determine new completed status
        let newCompletedStatus = rowData.completed === true; // true if checked, false if unchecked

        // Update work order operations
        for (let workOrder of workOrders) {
            console.log(`Updating Work Order Operation: ${workOrder.rowKey}`);

            await $dgSetRowVals('workOrderOperations', workOrder.rowKey, {
                completed: newCompletedStatus,
                completedDate: newCompletedStatus ? new Date().toISOString() : null
            });

            console.log(`Successfully updated Work Order Operation ${workOrder.rowKey} to completed: ${newCompletedStatus}`);
        }

        // Update work order materials
        for (let material of workMaterials) {
            console.log(`Updating Work Order Material: ${material.rowKey}`);

            await $dgSetRowVals('workOrderMaterials', material.rowKey, {
                wOComplete: newCompletedStatus // Toggle based on checkbox
            });

            console.log(`Successfully updated Work Order Material ${material.rowKey} to wOComplete: ${newCompletedStatus}`);
        }

        console.log("All Work Order Operations and Materials updated successfully.");

    } catch (error) {
        console.error("Error updating Work Order Operations or Materials:", error);
    }
}, 500);

hotJob.onChange:
setTimeout(async () => {
    try {
        console.log("Script started. Checking workOrderOperations and workOrderMaterials for:", rowData.rowKey);

        let allWorkOrders = $getGrid('workOrderOperations');
        let allMaterials = $getGrid('workOrderMaterials');

        let workOrders = allWorkOrders.filter(op => op.workOrder === rowData.rowKey);
        let workMaterials = allMaterials.filter(mat => mat.workOrder === rowData.rowKey);

        if (!workOrders.length && !workMaterials.length) {
            console.warn(`No related Work Order Operations or Materials found for workOrder: ${rowData.rowKey}`);
            return;
        }

        let newHotJobStatus = rowData.hotJob === true; // Toggle based on checkbox state

        console.log(`Updating hotJob to ${newHotJobStatus} for ${workOrders.length} Work Order Operations and ${workMaterials.length} Work Order Materials.`);

        // Update all Work Order Operations to match the Work Order's hotJob status
        await Promise.all(workOrders.map(workOrder =>
            $dgSetRowVals('workOrderOperations', workOrder.rowKey, {
                hotJob: newHotJobStatus
            })
        ));

        // Update all Work Order Materials to match the Work Order's hotJob status
        await Promise.all(workMaterials.map(material =>
            $dgSetRowVals('workOrderMaterials', material.rowKey, {
                hotJob: newHotJobStatus
            })
        ));

        console.log(`All related Work Order Operations and Materials have been updated to hotJob: ${newHotJobStatus}`);
    } catch (error) {
        console.error("Error updating Work Order Operations or Materials:", error);
    }
}, 500);

